    return ( 
      <div className = "search-container" >   
        <header>
          <nav>
          <input 
            className="input-field"
           value = {searchTerm}
           type = 'text' 
           name =' Search' 
           placeholder = 'Search country by name ... ' 
           onChange = {handleChange}   
         />
         <ul>
           <li>Home</li>
           <li>Home</li>
         </ul>

          </nav>

        </header> 
      </div>  
    );
}
